insert  into `android_issue_detail`(`issue_id`,`issue_type`,`issue_found_version`,`issue_detail`,`mantis_id`,`create_time`,`save_to_mantis_status`) values (36,'memoryLeak','3.5.1_dev','PPAJsController中保存了Activity的引用，并且当web页关闭之后也没有将mActivity置空。    3.5版本在destory上置为空，下一个版本计划通过回调接口形式将界面相关的东西交还给界面处理，避免参数不断忘里传递最后没管理好导致内存泄露','398929','2015-05-28 16:54:12','success'),(37,'memoryLeak','3.5.1_dev','PPSearchFragment中，搜索出现框计算时，StateView存在内存泄露。','398930','2015-05-28 16:54:22','success'),(38,'memoryLeak','3.5.1_dev','PPHomeSearchView中注册了PPDefaultWordChangedCallback回调没有释放。','398931','2015-05-28 16:54:38','success'),(39,'memoryLeak','3.5.1_dev','PPKooMovieManager PPKooMovieFragment中的一个匿名OnKooMovieRestoreCallBack 注册后没有释放。','398932','2015-05-28 16:54:50','success'),(40,'memoryLeak','3.5.1_dev','PPKooMovieImageCategoryFragment中PPKooMovieManager.getInstance().registerTaskChangedListener(mKooMovieTask.hashCode, getTaskChangedListener());   getTaskChangedListener方法返回匿名内部类，导致该listener不能被remove。   页面销毁时反注册','398934','2015-05-28 16:55:05','success'),(41,'memoryLeak','3.5.1_dev','PPBaseActivity startBarcodeActivity中 PPBarcodeReceiver.getInstance(this).registerBarCodeReceiver(); 将activity传入了一个单例中。','398935','2015-05-28 16:55:15','success'),(42,'memoryLeak','3.5.1_dev','PPAJsController中导致CommonWebActivity不能释放   In com.pp.assistant:3.5.0_trial1:1339. * com.pp.assistant.activity.PPCommonWebActivity has leaked: * GC ROOT static com.pp.assistant.ajs.PPAJsController.sInstance * references com.pp.assistant.ajs.PPAJsController.mAppJSInterface * references com.pp.assistant.manager.PPAppJSInterface.mHandler * references android.os.Handler.mCallback * references com.pp.assistant.ajs.PPAJsWebAppStateController.mContext * leaks com.pp.assistant.activity.PPCommonWebActivity instance [ 05-27 10:28:08.455 12950:18389 D/LeakCanary ]','398936','2015-05-28 16:55:35','success'),(43,'memoryLeak','3.5.1_dev','PPHomeFindFragment中 mOnDataSetChangedListener注册后并没有释放导致PPImageScanFragment不能释放。  PPImageScanFragment中会获取前一个页面的引用，用于获取下一页的数据，并且把自己设到前一个页面做回调，但是由于PPHomeFindFragment由于是在主页中，不会被销毁，故PPImageScanFragment不能释放。   该接口为PPIWPController。实现了该接口的Fragment并且把Listener(PPImageScanFragment)保存下来的都会存在这个问题。只要这些页面还存在，PPImageScanFragment就会存在。   ================Wed May 27 14:11:51 GMT+08:00 2015 In com.pp.assistant:3.5.0_trial1:1339. * com.pp.assistant.activity.PPDefaultFragmentActivity has leaked: * GC ROOT static com.pp.assistant.activity.PPMainActivity.sInstance * references com.pp.assistant.activity.PPMainActivity.mFragments * references java.util.ArrayList.array * references array java.lang.Object[].[3] * references com.pp.assistant.fragment.PPHomeFindFragment.mOnDataSetChangedListener * references com.pp.assistant.fragment.PPImageScanFragment.mActivity * leaks com.pp.assistant.activity.PPDefaultFragmentActivity instance * Reference Key: b46e1fa4-63e2-48ca-b948-ee1537b67047 * Device: samsung samsung SM-P600 lt03wifizc * Android Version: 4.4.2 API: 19 LeakCanary: 1.3.1 * Durations: watch=5129ms, gc=228ms, heap dump=1080ms, analysis=17425ms','398937','2015-05-28 16:56:01','success'),(44,'memoryLeak','3.5.1_dev','PPRamCleanManager注册了callback没有remove，导致PPSecurityOptActivity不能释放。  PPSecurityScanHandler中有一个onExist方法。 在这个方法里添加PPRamCleanManager的remove方法。  ================Wed May 27 15:40:31 GMT+08:00 2015 In com.pp.assistant:3.5.0_trial1:1339. * com.pp.assistant.activity.PPSecurityOptActivity has leaked: * GC ROOT static com.pp.assistant.manager.PPRamCleanManager.instance * references com.pp.assistant.manager.PPRamCleanManager.mProcessChangeCallback * references com.pp.assistant.manager.handler.PPSecurityScanHandler.mListener * references com.pp.assistant.fragment.PPSecurityOptFragment.mActivity * leaks com.pp.assistant.activity.PPSecurityOptActivity instance * Reference Key: a94c3174-7c42-4410-90f3-0bd823223fe9 * Device: samsung google Galaxy Nexus yakju * Android Version: 4.4.4 API: 19 LeakCanary: 1.3.1 * Durations: watch=5055ms, gc=159ms, heap dump=1327ms, analysis=15840ms','398939','2015-05-28 16:56:24','success'),(45,'memoryLeak','3.5.1_dev','PPGameGiftStateView向PPGameGiftStateManager注册后，并没有remove。导致这个View不能释放，从而使得整个Activity不能被释放。','398940','2015-05-28 16:56:35','success'),(46,'memoryLeak','3.5.1_dev','PPAJsController中的PPAJsApiInterface mAJsApi里面保存了一个activity，导致activity泄露。','398941','2015-05-28 16:56:43','success'),(47,'memoryLeak','3.5.1_devdd','1','','2015-05-28 17:00:59','error'),(48,'memoryLeak','3.5.1_devdd','1','','2015-05-28 17:09:46','error');

