  `create_time` datetime DEFAULT NULL,
  `done_time` datetime DEFAULT NULL,
  `pp_server_url` varchar(255) DEFAULT NULL,
  `signature` varchar(10) DEFAULT NULL,
  `pack_task_status` varchar(30) DEFAULT 'waiting' COMMENT 'waiting:等待中, success:完成, processing:执行中 ,failed:失败',
  `build_type` varchar(30) DEFAULT 'continuous' COMMENT 'continuous表示持续构建，manual表示单次构建',
  `apk_url` varchar(255) DEFAULT NULL,
  `main_repository_branch` varchar(50) DEFAULT NULL COMMENT 'pp助手客户端Main工程的分支',
  `main_repository_tag` varchar(100) DEFAULT NULL COMMENT 'pp助手客户端Main工程打的Tag',
  `common_repository_branch` varchar(50) DEFAULT NULL COMMENT 'pp助手客户端Common工程的分支',
  `common_repository_tag` varchar(50) DEFAULT NULL COMMENT 'pp助手客户端Common工程打的Tag',
  `bar_code_repository_branch` varchar(50) DEFAULT 'master' COMMENT 'pp助手客户端barCode工程的分支，目前只有master',
  `bar_code_repository_tag` varchar(50) DEFAULT NULL COMMENT 'pp助手客户端barCode工程的Tag，一般为空',
  `version_code` varchar(50) DEFAULT NULL COMMENT '替换AndroidManifest.xml中的versionCode',
  `version_name` varchar(50) DEFAULT NULL COMMENT '替换AndroidManifest.xml中的versionName',
  `job_url` varchar(255) DEFAULT NULL,
  `agoo_key` varchar(50) DEFAULT NULL,
  `agoo_secret` varchar(50) DEFAULT NULL,
  `apk_md5` varchar(32) DEFAULT NULL,
  `release_apk_md5` varchar(32) DEFAULT NULL,
  `apk_byte_size` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`task_id`),
  KEY `FK_PACK_TASK_MAIN_TASK` (`main_task_id`),
  CONSTRAINT `FK_PACK_TASK_MAIN_TASK` FOREIGN KEY (`main_task_id`) REFERENCES `android_main_task` (`main_task_id`)
) ENGINE=InnoDB AUTO_INCREMENT=140 DEFAULT CHARSET=utf8;

