/*Table structure for table `android_sub_task` */

DROP TABLE IF EXISTS `android_sub_task`;

CREATE TABLE `android_sub_task` (
  `sub_task_id` int(11) NOT NULL AUTO_INCREMENT,
  `main_task_id` int(11) NOT NULL COMMENT '主任务id',
  `test_type_id` int(11) NOT NULL COMMENT '测试类型id',
  `url` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `result` varchar(20) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'pass or fail',
  `creatTime` datetime DEFAULT NULL COMMENT '子任务创建时间',
  `endTime` datetime DEFAULT NULL COMMENT '子任务结束时间',
  `device_id` int(11) DEFAULT NULL COMMENT '设备信息',
  `sub_task_status` varchar(30) DEFAULT 'waiting' COMMENT 'waiting:等待中, success:完成, processing:执行中 ,failed:失败',
  PRIMARY KEY (`sub_task_id`),
  KEY `FK_SUB_TASK_MAIN_TASK` (`main_task_id`),
  CONSTRAINT `FK_SUB_TASK_MAIN_TASK` FOREIGN KEY (`main_task_id`) REFERENCES `android_main_task` (`main_task_id`)
) ENGINE=InnoDB AUTO_INCREMENT=88 DEFAULT CHARSET=utf8;

